import React, {Component} from 'react';
import PropTypes from 'prop-types';
class TodosList extends Component{

    render(){
        //console.log(this.props.todos)
        return this.props.todos.map((todo) => (
                <div>{todo.title}</div>
            )
            );
    }
}
// TodosList.PropTypes = {
